(1, 1, NULL, 1, 'demo-storage', 'BoxiBox Storage', NULL, '#0D9488', '#0F766E', 'Bienvenue ! Réservez votre espace de stockage en quelques clics. Des box de toutes tailles disponibles 24h/24.', 'CONDITIONS GÉNÉRALES DE LOCATION\n\n1. OBJET\nLes présentes conditions générales régissent la location d\'espaces de stockage.\n\n2. DURÉE\nLa location est conclue pour une durée minimale d\'un mois, renouvelable tacitement.\n\n3. PRIX\nLe prix est celui indiqué lors de la réservation. Il est payable mensuellement d\'avance.\n\n4. DÉPÔT DE GARANTIE\nUn dépôt de garantie équivalent à un mois de loyer est demandé.\n\n5. ACCÈS\nL\'accès au box est possible 24h/24 et 7j/7 avec le code personnel.\n\n6. ASSURANCE\nLe locataire doit assurer ses biens entreposés.\n\n7. RÉSILIATION\nLa résiliation se fait avec un préavis d\'un mois.', 1, '0.00', '100.00', 30, 90, 0, 1, 1, '[\"card\",\"bank_transfer\",\"sepa\"]', 'pk_test_demo', NULL, 1, '{\"monday\":[\"09:00\",\"18:00\"],\"tuesday\":[\"09:00\",\"18:00\"],\"wednesday\":[\"09:00\",\"18:00\"],\"thursday\":[\"09:00\",\"18:00\"],\"friday\":[\"09:00\",\"18:00\"],\"saturday\":[\"10:00\",\"16:00\"],\"sunday\":null}', 'contact@boxibox-demo.fr', '+33 1 23 45 67 89', NULL, NULL, '2025-12-03 04:38:26', '2025-12-03 04:42:19');

