-- --------------------------------------------------------

--
-- Structure de la table `boxes`
--

CREATE TABLE `boxes` (
  `id` bigint(20) UNSIGNED NOT NULL,
  `tenant_id` bigint(20) UNSIGNED NOT NULL,
  `site_id` bigint(20) UNSIGNED NOT NULL,
  `building_id` bigint(20) UNSIGNED DEFAULT NULL,
  `floor_id` bigint(20) UNSIGNED DEFAULT NULL,
  `number` varchar(255) NOT NULL,
  `name` varchar(255) DEFAULT NULL,
  `length` decimal(8,2) NOT NULL,
  `width` decimal(8,2) NOT NULL,
  `height` decimal(8,2) NOT NULL,
  `volume` decimal(10,2) GENERATED ALWAYS AS (`length` * `width` * `height`) VIRTUAL,
  `status` enum('available','occupied','reserved','maintenance','unavailable') NOT NULL DEFAULT 'available',
  `available_from` date DEFAULT NULL,
  `base_price` decimal(10,2) NOT NULL,
  `current_price` decimal(10,2) DEFAULT NULL,
  `climate_controlled` tinyint(1) NOT NULL DEFAULT 0,
  `has_electricity` tinyint(1) NOT NULL DEFAULT 0,
  `has_alarm` tinyint(1) NOT NULL DEFAULT 0,
  `has_camera` tinyint(1) NOT NULL DEFAULT 0,
  `drive_up_access` tinyint(1) NOT NULL DEFAULT 0,
  `ground_floor` tinyint(1) NOT NULL DEFAULT 0,
  `indoor` tinyint(1) NOT NULL DEFAULT 1,
  `position` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL CHECK (json_valid(`position`)),
  `current_contract_id` bigint(20) UNSIGNED DEFAULT NULL,
  `current_customer_id` bigint(20) UNSIGNED DEFAULT NULL,
  `occupied_since` date DEFAULT NULL,
  `access_code` varchar(255) DEFAULT NULL,
  `lock_serial` varchar(255) DEFAULT NULL,
  `main_image` varchar(255) DEFAULT NULL,
  `images` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL CHECK (json_valid(`images`)),
  `description` text DEFAULT NULL,
  `internal_notes` text DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

