-- Structure de la table `chatbot_configurations`
--

CREATE TABLE `chatbot_configurations` (
  `id` bigint(20) UNSIGNED NOT NULL,
  `tenant_id` bigint(20) UNSIGNED NOT NULL,
  `name` varchar(255) NOT NULL DEFAULT 'BoxBot',
  `avatar_url` varchar(255) DEFAULT NULL,
  `welcome_message` varchar(255) NOT NULL DEFAULT 'Bonjour ! Comment puis-je vous aider ?',
  `system_prompt` text DEFAULT NULL,
  `primary_color` varchar(255) NOT NULL DEFAULT '#4f46e5',
  `position` varchar(255) NOT NULL DEFAULT 'bottom-right',
  `show_on_mobile` tinyint(1) NOT NULL DEFAULT 1,
  `can_book` tinyint(1) NOT NULL DEFAULT 1,
  `can_quote` tinyint(1) NOT NULL DEFAULT 1,
  `can_check_availability` tinyint(1) NOT NULL DEFAULT 1,
  `can_answer_faq` tinyint(1) NOT NULL DEFAULT 1,
  `can_transfer_to_human` tinyint(1) NOT NULL DEFAULT 1,
  `human_availability` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL CHECK (json_valid(`human_availability`)),
  `transfer_email` varchar(255) DEFAULT NULL,
  `transfer_phone` varchar(255) DEFAULT NULL,
  `languages` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL,
  `default_language` varchar(255) NOT NULL DEFAULT 'fr',
  `whatsapp_enabled` tinyint(1) NOT NULL DEFAULT 0,
  `whatsapp_number` varchar(255) DEFAULT NULL,
  `whatsapp_api_key` varchar(255) DEFAULT NULL,
  `is_active` tinyint(1) NOT NULL DEFAULT 1,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

