-- --------------------------------------------------------

--
-- Structure de la table `contracts`
--

CREATE TABLE `contracts` (
  `id` bigint(20) UNSIGNED NOT NULL,
  `tenant_id` bigint(20) UNSIGNED NOT NULL,
  `site_id` bigint(20) UNSIGNED NOT NULL,
  `customer_id` bigint(20) UNSIGNED NOT NULL,
  `box_id` bigint(20) UNSIGNED NOT NULL,
  `contract_number` varchar(255) NOT NULL,
  `status` enum('draft','pending_signature','active','expired','terminated','cancelled') NOT NULL DEFAULT 'draft',
  `type` enum('standard','short_term','long_term') NOT NULL DEFAULT 'standard',
  `start_date` date NOT NULL,
  `end_date` date DEFAULT NULL,
  `actual_end_date` date DEFAULT NULL,
  `notice_period_days` int(11) NOT NULL DEFAULT 30,
  `auto_renew` tinyint(1) NOT NULL DEFAULT 1,
  `renewal_period` enum('monthly','quarterly','yearly') NOT NULL DEFAULT 'monthly',
  `monthly_price` decimal(10,2) NOT NULL,
  `deposit_amount` decimal(10,2) NOT NULL DEFAULT 0.00,
  `deposit_paid` tinyint(1) NOT NULL DEFAULT 0,
  `discount_percentage` decimal(5,2) NOT NULL DEFAULT 0.00,
  `discount_amount` decimal(10,2) NOT NULL DEFAULT 0.00,
  `billing_frequency` enum('monthly','quarterly','yearly') NOT NULL DEFAULT 'monthly',
  `billing_day` int(11) NOT NULL DEFAULT 1,
  `payment_method` enum('card','bank_transfer','cash','sepa') NOT NULL DEFAULT 'card',
  `auto_pay` tinyint(1) NOT NULL DEFAULT 0,
  `access_code` varchar(10) DEFAULT NULL,
  `key_given` tinyint(1) NOT NULL DEFAULT 0,
  `key_returned` tinyint(1) NOT NULL DEFAULT 0,
  `signed_by_customer` tinyint(1) NOT NULL DEFAULT 0,
  `customer_signed_at` timestamp NULL DEFAULT NULL,
  `customer_signature` varchar(255) DEFAULT NULL,
  `signed_by_staff` tinyint(1) NOT NULL DEFAULT 0,
  `staff_user_id` bigint(20) UNSIGNED DEFAULT NULL,
  `staff_signature` varchar(255) DEFAULT NULL,
  `staff_signed_at` timestamp NULL DEFAULT NULL,
  `pdf_path` varchar(255) DEFAULT NULL,
  `termination_reason` enum('customer_request','non_payment','breach','end_of_term','other') DEFAULT NULL,
  `termination_notes` text DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

